import React from "react";
import "../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import "../assets/sty_modal.css";
import data from "./modal_data";

const Modal = () => {
  return (
    <>
      <h1>modal</h1>
      {data.cardData.map()}
      {console.warn(data.cardData)}
    </>
  );
};
export default Modal;
